function calculateReq(t,a=5){let c=t+1,l=(5*c-5+Math.pow(c,2)+Math.pow(c,3)-2)*a;return l}function calculatePct(t,a=5,c,l=0){let e=calculateReq(t,a),u=calculateReq(t-1,a),o=e-u,n=c-u,r=Math.floor(n/o*100*Math.pow(10,l))/Math.pow(10,l);return r}module.exports={calculateReq:calculateReq,calculatePct:calculatePct};